      output: AppFeature/Sources/App/Resource/Generated/Strings+Generated.swift
xcassets:
  inputs: AppFeature/Sources/App/Resource/Assets.xcassets
  outputs:
    - templateName: swift5
      output: AppFeature/Sources/App/Resource/Generated/Assets+Generated.swift
fonts:
  inputs: AppFeature/Sources/App/Resource/Font
