      output: AppFeature/Sources/App/Resource/Generated/Fonts+Generated.swift
plist:
  inputs: AppFeature/Sources/App/Resource/Environment.plist
  outputs:
    - templateName: runtime-swift5
      output: AppFeature/Sources/App/Resource/Generated/Plist+Generated.swift
